import React from 'react';

class Navbar extends React.Component{
    

    render(){
        
        return(
            <div style={styles.cartIconContainer}>
                <img style={styles.cartIcon} src="https://t3.ftcdn.net/jpg/00/73/10/64/240_F_73106428_Q91LNUigg4ZRIi1ItxIcgEzyW8C9yluE.jpg" alt='cart-icon' />
                <span style={styles.cartCount}>3</span>
              
            </div>
        )
    }
}

const styles = {
    cartIcon: {
      height: 32,
      marginRight: 20
    },
    nav: {
      height: 70,
      background: '#4267b2',
      display: 'flex',
      justifyContent: 'flex-end',
      alignItems: 'center'
    },
    cartIconContainer: {
      position: 'relative'
    },
    cartCount: {
      background: 'yellow',
      borderRadius: '50%',
      padding: '4px 8px',
      position: 'absolute',
      right: 0,
      top: -9
    }
  };


export default Navbar;
